            base.m_prods[this.m_prodData[index]] = new SSYaccTableProd(this.m_prodData[index + 1], this.m_prodData[index + 2]);
            index += 3;
        }
        index = 0;
        for (int j = 0; j < 0x100; j++)
        {
            base.m_rows[j] = new SSYaccTableRow(this.m_rowData, index);
            int num4 = (this.m_rowData[index] + this.m_rowData[index + 1]) + this.m_rowData[index + 2];
            index += 5 + (num4 * 4);
        }
    }
}

